import logo from "./logo.svg";
import "./App.css";
// var celestiump2p = require('celestiump2p');
import * as celestiumClient from 'celestiump2p';

function App() {
  state = {
    meta_data: {
      block_chain_len: 0,
    },
    block_chain: null,
  };

  celestiumClient.RTCPeerConnection = RTCPeerConnection;
  celestiumClient.RTCSessionDescription = RTCSessionDescription;
  celestiumClient.RTCIceCandidate = RTCIceCandidate;
  celestiumClient.io = CIO;

  let c1 = celestiumClient.initNewClient();
  c1.gotConnection = () => {
    c1.sendOffer(state.meta_data);
  };
  c1.gotOffer = (other_meta_data) => {
    console.log("recived meta data on offer", other_meta_data);
    return state.meta_data;
  };
  c1.gotAnswer = (other_meta_data) => {
    console.log("recived meta data on answer", other_meta_data);
    return state.meta_data;
  };
  c1.gotCandidate = (other_meta_data) => {
    console.log("recived meta data on candidate", other_meta_data);
    return state.meta_data;
  };
  c1.gotDataChannel = () => {
    c1.send("ping");
  };
  c1.gotData = (data) => {
    console.log(data);
    if (data == "ping") {
      c1.send("pong");
    } else {
      c1.send("ping");
    }
  };

  c1.channelClosed = () => {
    console.log("channel closed");
    c1 = null;
  }
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
